def initialize(self, path: str, default_filename: str=None) -> None:
    self.root = path
    self.default_filename = default_filename

@classmethod
def reset(cls) -> None:
    with cls._lock:
        cls._static_hashes = {}

async def get(self, path: str, include_body: bool=True) -> None:
    self.path = self.parse_url_path(path)
    del path
    absolute_path = self.get_absolute_path(self.root, self.path)
    self.absolute_path = self.validate_absolute_path(self.root, absolute_path)
    if self.absolute_path is None:
        return
    self.modified = self.get_modified_time()
    self.set_headers()
    if self.should_return_304():
        self.set_status(304)
        return
    request_range = None
    range_header = self.request.headers.get('Range')
    if range_header:
        request_range = httputil._parse_request_range(range_header)
    size = self.get_content_size()
    if request_range:
        start, end = request_range
        if start is not None and start >= size or end == 0:
            self.set_status(416)
            self.set_header('Content-Type', 'text/plain')
            self.set_header('Content-Range', 'bytes */%s' % (size,))
            return
        if start is not None and start < 0:
            start += size
        if end is not None and end > size:
            end = size
        if size != (end or size) - (start or 0):
            self.set_status(206)
            self.set_header('Content-Range', httputil._get_content_range(start, end, size))
    else:
        start = end = None
    if start is not None and end is not None:
        content_length = end - start
    elif end is not None:
        content_length = end
    elif start is not None:
        content_length = size - start
    else:
        content_length = size
    self.set_header('Content-Length', content_length)
    if include_body:
        content = self.get_content(self.absolute_path, start, end)
        if isinstance(content, bytes):
            content = [content]
        for chunk in content:
            try:
                self.write(chunk)
                await self.flush()
            except iostream.StreamClosedError:
                return
    else:
        assert self.request.method == 'HEAD'

def should_return_304(self) -> bool:
    """Returns True if the headers indicate that we should return 304.

    .. versionadded:: 3.1
    """
    if self.request.headers.get('If-None-Match'):
        return self.check_etag_header()
    ims_value = self.request.headers.get('If-Modified-Since')
    if ims_value is not None:
        date_tuple = email.utils.parsedate(ims_value)
        if date_tuple is not None:
            if_since = datetime.datetime(*date_tuple[:6])
            assert self.modified is not None
            if if_since >= self.modified:
                return True
    return False

@classmethod
def get_content(cls, abspath: str, start: int=None, end: int=None) -> Generator[bytes, None, None]:
    """Retrieve the content of the requested resource which is located
    at the given absolute path.

    This class method may be overridden by subclasses.  Note that its
    signature is different from other overridable class methods
    (no ``settings`` argument); this is deliberate to ensure that
    ``abspath`` is able to stand on its own as a cache key.

    This method should either return a byte string or an iterator
    of byte strings.  The latter is preferred for large files
    as it helps reduce memory fragmentation.

    .. versionadded:: 3.1
    """
    with open(abspath, 'rb') as file:
        if start is not None:
            file.seek(start)
        if end is not None:
            remaining = end - (start or 0)
        else:
            remaining = None
        while True:
            chunk_size = 64 * 1024
            if remaining is not None and remaining < chunk_size:
                chunk_size = remaining
            chunk = file.read(chunk_size)
            if chunk:
                if remaining is not None:
                    remaining -= len(chunk)
                yield chunk
            else:
                if remaining is not None:
                    assert remaining == 0
                return

@classmethod
def get_content_version(cls, abspath: str) -> str:
    """Returns a version string for the resource at the given path.

    This class method may be overridden by subclasses.  The
    default implementation is a hash of the file's contents.

    .. versionadded:: 3.1
    """
    data = cls.get_content(abspath)
    hasher = hashlib.md5()
    if isinstance(data, bytes):
        hasher.update(data)
    else:
        for chunk in data:
            hasher.update(chunk)
    return hasher.hexdigest()

def _stat(self) -> os.stat_result:
    assert self.absolute_path is not None
    if not hasattr(self, '_stat_result'):
        self._stat_result = os.stat(self.absolute_path)
    return self._stat_result

def get_content_type(self) -> str:
    """Returns the ``Content-Type`` header to be used for this request.

    .. versionadded:: 3.1
    """
    assert self.absolute_path is not None
    mime_type, encoding = mimetypes.guess_type(self.absolute_path)
    if encoding == 'gzip':
        return 'application/gzip'
    elif encoding is not None:
        return 'application/octet-stream'
    elif mime_type is not None:
        return mime_type
    else:
        return 'application/octet-stream'

def set_extra_headers(self, path: str) -> None:
    """For subclass to add extra headers to the response"""
    pass

@classmethod
def _get_cached_version(cls, abs_path: str) -> Optional[str]:
    with cls._lock:
        hashes = cls._static_hashes
        if abs_path not in hashes:
            try:
                hashes[abs_path] = cls.get_content_version(abs_path)
            except Exception:
                gen_log.error('Could not open static file %r', abs_path)
                hashes[abs_path] = None
        hsh = hashes.get(abs_path)
        if hsh:
            return hsh
    return None

