@classmethod
def reset(cls) -> None:
    with cls._lock:
        cls._static_hashes = {}

def should_return_304(self) -> bool:
    """Returns True if the headers indicate that we should return 304.

    .. versionadded:: 3.1
    """
    # If client sent If-None-Match, use it, ignore If-Modified-Since
    if self.request.headers.get("If-None-Match"):
        return self.check_etag_header()

    # Check the If-Modified-Since, and don't send the result if the
    # content has not been modified
    ims_value = self.request.headers.get("If-Modified-Since")
    if ims_value is not None:
        date_tuple = email.utils.parsedate(ims_value)
        if date_tuple is not None:
            if_since = datetime.datetime(*date_tuple[:6])
            assert self.modified is not None
            if if_since >= self.modified:
                return True

    return False

@classmethod
def get_content(
    cls, abspath: str, start: int = None, end: int = None
) -> Generator[bytes, None, None]:
    """Retrieve the content of the requested resource which is located
    at the given absolute path.

    This class method may be overridden by subclasses.  Note that its
    signature is different from other overridable class methods
    (no ``settings`` argument); this is deliberate to ensure that
    ``abspath`` is able to stand on its own as a cache key.

    This method should either return a byte string or an iterator
    of byte strings.  The latter is preferred for large files
    as it helps reduce memory fragmentation.

    .. versionadded:: 3.1
    """
    with open(abspath, "rb") as file:
        if start is not None:
            file.seek(start)
        if end is not None:
            remaining = end - (start or 0)  # type: Optional[int]
        else:
            remaining = None
        while True:
            chunk_size = 64 * 1024
            if remaining is not None and remaining < chunk_size:
                chunk_size = remaining
            chunk = file.read(chunk_size)
            if chunk:
                if remaining is not None:
                    remaining -= len(chunk)
                yield chunk
            else:
                if remaining is not None:
                    assert remaining == 0
                return

@classmethod
def get_content_version(cls, abspath: str) -> str:
    """Returns a version string for the resource at the given path.

    This class method may be overridden by subclasses.  The
    default implementation is a hash of the file's contents.

    .. versionadded:: 3.1
    """
    data = cls.get_content(abspath)
    hasher = hashlib.md5()
    if isinstance(data, bytes):
        hasher.update(data)
    else:
        for chunk in data:
            hasher.update(chunk)
    return hasher.hexdigest()

def _stat(self) -> os.stat_result:
    assert self.absolute_path is not None
    if not hasattr(self, "_stat_result"):
        self._stat_result = os.stat(self.absolute_path)
    return self._stat_result

def set_extra_headers(self, path: str) -> None:
    """For subclass to add extra headers to the response"""
    pass

@classmethod
def _get_cached_version(cls, abs_path: str) -> Optional[str]:
    with cls._lock:
        hashes = cls._static_hashes
        if abs_path not in hashes:
            try:
                hashes[abs_path] = cls.get_content_version(abs_path)
            except Exception:
                gen_log.error("Could not open static file %r", abs_path)
                hashes[abs_path] = None
        hsh = hashes.get(abs_path)
        if hsh:
            return hsh
    return None

def initialize(
    self, fallback: Callable[[httputil.HTTPServerRequest], None]
) -> None:
    self.fallback = fallback

def transform_first_chunk(
    self,
    status_code: int,
    headers: httputil.HTTPHeaders,
    chunk: bytes,
    finishing: bool,
) -> Tuple[int, httputil.HTTPHeaders, bytes]:
    # TODO: can/should this type be inherited from the superclass?
    if "Vary" in headers:
        headers["Vary"] += ", Accept-Encoding"
    else:
        headers["Vary"] = "Accept-Encoding"
    if self._gzipping:
        ctype = _unicode(headers.get("Content-Type", "")).split(";")[0]
        self._gzipping = (
            self._compressible_type(ctype)
            and (not finishing or len(chunk) >= self.MIN_LENGTH)
            and ("Content-Encoding" not in headers)
        )
    if self._gzipping:
        headers["Content-Encoding"] = "gzip"
        self._gzip_value = BytesIO()
        self._gzip_file = gzip.GzipFile(
            mode="w", fileobj=self._gzip_value, compresslevel=self.GZIP_LEVEL
        )
        chunk = self.transform_chunk(chunk, finishing)
        if "Content-Length" in headers:
            # The original content length is no longer correct.
            # If this is the last (and only) chunk, we can set the new
            # content-length; otherwise we remove it and fall back to
            # chunked encoding.
            if finishing:
                headers["Content-Length"] = str(len(chunk))
            else:
                del headers["Content-Length"]
    return status_code, headers, chunk

def transform_chunk(self, chunk: bytes, finishing: bool) -> bytes:
    if self._gzipping:
        self._gzip_file.write(chunk)
        if finishing:
            self._gzip_file.close()
        else:
            self._gzip_file.flush()
        chunk = self._gzip_value.getvalue()
        self._gzip_value.truncate(0)
        self._gzip_value.seek(0)
    return chunk

@functools.wraps(method)
def wrapper(  # type: ignore
    self: RequestHandler, *args, **kwargs
) -> Optional[Awaitable[None]]:
    if not self.current_user:
        if self.request.method in ("GET", "HEAD"):
            url = self.get_login_url()
            if "?" not in url:
                if urllib.parse.urlsplit(url).scheme:
                    # if login url is absolute, make next absolute too
                    next_url = self.request.full_url()
                else:
                    assert self.request.uri is not None
                    next_url = self.request.uri
                url += "?" + urlencode(dict(next=next_url))
            self.redirect(url)
            return None
        raise HTTPError(403)
    return method(self, *args, **kwargs)

